    while ((match = regex.exec(inputString)) !== null) {
        // 这是为了避免在不匹配的位置无限循环
        if (match.index === regex.lastIndex) {
            regex.lastIndex++;
        }

        // 匹配到的字符串添加到数组中
        matches.push(match[1]);
    }

    return matches;
}

